import { auth } from '../firebase_config'
import React, { Component } from 'react';

console.log(auth.currentUser)

class Accueilconnexion extends Component {
    render() {
        return (
            <div>
                <Navbar user={ this.state.user} username={ this.state.userName } userchange={ this.userChange } />
                <h1>Salut { this.props.username} !</h1>
            </div>
        );
    }
}

export default Accueilconnexion;
